data.value:
使用动态JSON对象树作为单元格的数据源，JSON格式示例如下
[
    {
        "value": 1,
        "label": "部门1",
        "children": [
            {
                "value": 2,
                "label": "二级部门1"
            },
            {
                "value": 3,
                "label": "二级部门2",
                "children": [
                    {
                       "value": 4,
                       "label": "三级部门1"
                    }
                ]
            }
        ]
    },
    {
        "value": 5,
        "label": "部门2"
    },
    {
        "value": 6,
        "label": "部门3"
    }
]
以上数据假设‘值属性’为value，‘标签属性名’为label,‘下级属性名’为‘children’
通常情况下，JSON数据源可以通过HTTP请求命令从Web服务获取，也可以通过服务端命令获取

